import React from "react";
import { useEffect } from "react";
import { useState } from "react";
import axios from "axios";

const Products = () => {
    const [products, setProducts] = useState([]);

    useEffect(() => {
        const fetchProducts = async () => {
            const { data } = await axios.get("http://localhost:3001/products/allpr", {withCredentials: true});
            console.log(data);
            setProducts(data);
        };
        fetchProducts();
    }, []);

    return (
        products.map((product) => (
            <div className="product" key={product.pr_id}>
                <div className="product__info">
                    <p className="info__name">{product.pr_name}</p>
                    <p className="info__price">${product.pr_stock}</p>
                    <p className="info__price">${product.pr_category}</p>
                </div>
            </div>
        ))
    );
};

export default Products;
